import React from 'react'
import './Home.css'
import BuyCard from 'components/Controllers/BuyCard'
import styled from 'styled-components'
import { TYPE } from 'theme'

const Home = () => {
  return (
    <>
      <MainContainer>
        <BuyCard />
        <TYPE.btn style={{ marginTop: '-10px', cursor: 'pointer' }}>Contact us</TYPE.btn>
      </MainContainer>
      <ConnectWalletModal />
    </>
  )
}

const MainContainer = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
`

export default Home
